import React, { Component } from "react";

class Buttons extends Component {
  constructor(props) {
    super(props);
    this.state = {
      type: ["gainers", "losers"]
    };
  }

  render() {
    return (
      <React.Fragment>
        <div className="btn-group" role="group" aria-label="Basic example">
          <button type="button" class="btn btn-secondary">
            Left
          </button>
          <button type="button" class="btn btn-secondary">
            Middle
          </button>
          <button type="button" class="btn btn-secondary">
            Right
          </button>
        </div>
      </React.Fragment>
    );
  }
}

export default Buttons;
